import React from "react";
import { Container } from "./HeroElements";
import logo from "../../assets/images/logo/stessis_white.svg";

function Hero() {
  return (
    <Container>
      <img src={logo} alt="Stessis Logo" />
    </Container>
  );
}

export default Hero;
